import React from "react";
import HyperCarPage from "./HyperCarPage";
import SportCarPage from "./SportCarPage";
import MomsCarPage from "./MomsCarPage";
import { Link } from "react-router-dom";
import "../Home.css";

function HomePage() {
  return (
    <div className="tri-card">
      <div className="link-container">
        <img className="image-card" src="https://media.istockphoto.com/photos/international-race-track-picture-id1156933946?k=20&m=1156933946&s=612x612&w=0&h=bVhv4K9fW3C7cIWc1ASScP44KAS0c9-hNc_wMYsEu5s=" />
        <Link  to="/hypercar"> Hyper Cars</Link>
      </div>
      <div className="link-container">
        <img className="image-card" src="https://media.istockphoto.com/photos/international-race-track-picture-id1156933946?k=20&m=1156933946&s=612x612&w=0&h=bVhv4K9fW3C7cIWc1ASScP44KAS0c9-hNc_wMYsEu5s=" />
        <Link to="/sportycar"> Sport Cars</Link>
      </div>
      <div className="link-container">
        <img className="image-card" src="https://media.istockphoto.com/photos/international-race-track-picture-id1156933946?k=20&m=1156933946&s=612x612&w=0&h=bVhv4K9fW3C7cIWc1ASScP44KAS0c9-hNc_wMYsEu5s=" />
        <Link to="/mommycar"> Mommy's Cars</Link>
      </div>
    </div>
  );
}

export default HomePage;
